import React from 'react';
import { ThemeProvider } from 'styled-components';
import GlobalStyles from 'components/styled/Global';
import Header from './components/Header';

const App = () => {
  return (
    <>
      <GlobalStyles />
      <ThemeProvider>
        <div className="outer-wrapper">
          <Header />
        </div>
      </ThemeProvider>
    </>
  );
};

export default App;
